Saison 3 - Episode 02 : Le château de Houska
Surement l’un des châteaux les plus mystérieux au monde. Sans aucun intérêt stratégique, avec des défenses tournées vers l’intérieur, personne ne sait qui a construit l’édifice et sa construction serait antérieure au christianisme. Une faille que les habitants surnomment « La Porte de l’enfer » se trouverait sous le château.  Durant la seconde guerre mondiale les nazis auraient pratiqués des expériences très troublantes sur les habitants des villages alentours.

